import React from 'react'
import { Link } from 'react-router-dom';
import * as rb from "react-bootstrap";

class Cse extends React.Component {
    render() { 
        return (
            <rb.Container>
                <ul className="flex-cols">
                    <li className="Semester"> Sem1</li>
                    <li className="Semester"> Sem2</li>
                    <li className="Semester"> Sem3</li>
                    <li className="Semester"> Sem4</li>
                    <li className="Semester"> Sem5</li>
                    <li className="Semester"> Sem6</li>
                    <li className="Semester"> Sem7</li>
                    <li className="Semester"> Sem8</li>
                    <i class="fa fa-venus" aria-hidden="true"></i>

                </ul>
            </rb.Container>
        );
    }
}

export default Cse;
